import React from 'react';
import { SimpleGrid, Heading, Image } from "@chakra-ui/react";

const NYC = () => {
  return (
    <div>
        <Heading
          size = 'xl'
          position = 'relative'
          right = '40%'
          fontFamily = 'monospace'
          top = '0px'>
            New York (Mostly Manhattan)
          </Heading>

      <SimpleGrid>

          <Image
          position = 'relative'
          src = {'./NYC1.jpg'}
          alt = "Wills Stern"
        />

      </SimpleGrid>

    </div>
  )
};

export default NYC;
